BlocklyGamesMsg["Music.helpText2b"] = "Створіть функцію, щоб зіграти перші чотири ноти пісні «Брате Жаку». Запустіть цю функцію двічі. Не додавайте нових нотних блоків.";
BlocklyGamesMsg["Music.helpText3"] = "Створіть іншу функцію для наступної частини пісні «Брате Жаку». Остання нота має бути довшою.";
BlocklyGamesMsg["Music.helpText4"] = "Створіть третю функцію для наступної частини пісні «Брате Жаку». Перші чотири ноти - коротші.";
BlocklyGamesMsg["Music.helpText5"] = "Завершіть мелодію пісні «Брате Жаку».";
BlocklyGamesMsg["Music.helpText6a"] = "Цей новий блок дозволяє вам використати інший музичний інструмент.";
BlocklyGamesMsg["Music.helpText6b"] = "Зіграйте свою мелодію на скрипці.";
BlocklyGamesMsg["Music.helpText7a"] = "Цей новий блок додає беззвучну затримку.";
BlocklyGamesMsg["Music.helpText7b"] = "Створіть другий стартовий блок з двома блоками затримки, після яких програється пісня «Брате Жаку».";
BlocklyGamesMsg["Music.helpText8"] = "Кожний стартовий блок повинен двічі грати пісню «Брате Жаку».";
BlocklyGamesMsg["Music.helpText9"] = "Створіть чотири стартові блоки, кожний з яких двічі виконує пісню «Брате Жаку». Додайте правильну кількість блоків затримки.";
BlocklyGamesMsg["Music.helpText10"] = "Створюйте все, що завгодно. Ви отримали величезну кількість нових блоків, які варто дослідити. Щасти вам!";
BlocklyGamesMsg["Music.helpText10Reddit"] = "Використовуйте кнопку \"Переглянути Галерею\", щоб прослухати мелодії інших людей. Якщо створили щось цікаве - скористайтесь кнопкою \"Зберегти в Галереї\", щоб поділитись музикою з іншими.";
BlocklyGamesMsg["Pond.scanTooltip"] = "Пошук супротивників. Вкажіть напрямок (0-360). Повертає відстань до найближчого супротивника в цьому напрямку. Повертає нескінченність, якщо супротивника не знайдено.";
