BlocklyGamesMsg["Pond.helpUseScan"] = "Ваше рішення працює, але можна зробити краще. Скористайтесь \"scan\", щоб вказати відстань для стрільби гармати.";
BlocklyGamesMsg["Pond.helpText1"] = "Використовуйте команду 'cannon', щоб уразити ціль. Перший параметр - кут, другий параметр - відстань. Знайдіть їх правильне поєднання.";
BlocklyGamesMsg["Pond.helpText2"] = "Ця ціль повинна бути вражена декілька разів. Використовуйте 'while (true)' щоб робити щось невизначений час.";
BlocklyGamesMsg["Pond.helpText3a"] = "Цей противник рухається вперед-назад, через це у нього важко влучити. Вираз 'scan' повертає точну відстань до противника в зазначеному напрямку.";
BlocklyGamesMsg["Pond.helpText3b"] = "Відстань - саме те, що потрібно команді 'cannon' для влучної стрільби.";
BlocklyGamesMsg["Pond.helpText4"] = "Цей противник надто далеко, щоб використовувати гармату (яка має обмеження в 70 метрів). Замість цього, використовуйте  команду 'swim', щоб плисти у бік противника та врізатися в нього.";
BlocklyGamesMsg["Pond.helpText5"] = "Цей противник також надто далеко, щоб використовувати гармату. Але ви занадто слабкі, щоб вижити при зіткненні. Пливіть у бік противника, поки відстань до нього стане меншою, ніж 50. Потім \"stop\" і використовуйте гармату.";
BlocklyGamesMsg["Pond.helpText6"] = "Цей супротивник буде відходити, якщо у нього влучили. Пливіть вперед, якщо він перебуває за межами досяжності (70 метрів).";
